import React from "react";
import IncDecButtons from "./IncDecButtons";
import addtolist from "../assets/addtolist.png";
import SelectElementMUI from "./SelectElementMUI";
const MenuItemPageCompsitems = () => {
  return (
    <div className="bg-white drop-shadow-lg rounded relative p-2 overflow-hidden my-5">
      <div className="flex relative justify-end font-nunito text-sm font-bold"></div>
      <p className="font-nunito font-extrabold text-lg">Beef Ham-Burger</p>
      <div className="flex justify-between align-baseline ">
        <IncDecButtons color={"red"} />
        <button className="w-32 border-primary border text-addtolist  my-3 rounded  hover:text-white hover:bg-addtolist transition-colors duration-75 ease-linear py-2 font-nunito font-extrabold text-sm flex justify-around px-4">
          <img
            src={addtolist}
            alt="+"
            style={{ height: "14px", width: "14px" }}
            className="block mr-1"
          />
          <p className="">Add to List</p>
        </button>
      </div>
      <div className="absolute top-0 left-0 bg-moneygreen rounded-tl rounded-br px-1">
        <p className="text-justify italic">Rs 150</p>
      </div>
    </div>
  );
};

export default MenuItemPageCompsitems;
